import React from "react";

import {  Route, Switch } from 'react-router-dom';
import About from "./About";
import Contact from "./Contact";


const App = () =>{
  return (
    <>
    <switch>
    <Route exact path="/"  component={Contact}  />

    <Route  exact path="/contact" component={About} />
    </switch>
    </>
    
  );

};

export default App;
